import Nav from "./Nav"
import { isLoggedIn } from "../global/Loginvalue";

const Courses = () => {


    if (isLoggedIn == false) {
        <div>
            <Nav />
            <h1> </h1>
        </div>

    }
    else {
        return
        <h1>This is Courses page</h1>
    }


}

export default Courses;
